script: |
  super -f text -I q1556.spq | sort > q1556.out

inputs:
  - name: q1556.spq
    data: |
      SELECT DISTINCT COUNT ( * ) FROM tab0 (FORMAT parquet) WHERE - col2 NOT IN ( - col1 * - col1 * - 61 - + 60, - col0, + col2, + - col1, + - 39 * - + 25 );
  - name: tab0

outputs:
  - name: q1556.out
    data: |
      3
